  @Input()
  thead!: TemplateRef<any>;

  @Input()
  tbody!: TemplateRef<any>
  constructor() { }

  ngOnInit(): void {

  }
  ngAfterViewInit() {

  }

  public get class(): string {
    var hover = ''
    if (this.hover === true) {

      hover = 'table-hover'
    }
    return hover
  }
}

